import React from 'react';
import { Link } from 'react-router-dom';
import {
  GenerateLinks,
  GenerateRoutes,
} from '../Routings.js';
import {
  SearchLinks,
  SearchRoutes,
} from './Search';

const prefix = "/algorithms";
const pages = [
  {
    "name": "test",
    "route": "test",
    "page": <h1>hi</h1>,
  }
];

export function AlgoLinks() {
  return (
    <>
      <h2>Algorithms</h2>
      <ul>
        { GenerateLinks({
            "prefix": prefix,
            "pages": pages,
        })
        .concat(SearchLinks().props.children)
        .map((page, i) => {
          return (
            <li key={i}>
              {page}
            </li>
          )
        })}

        { pages.map(page => {
          return (
            <li key={page.route}>
              <Link to={`/algorithms/${page.route}`}>
                {page.name}
              </Link>
            </li>
          )
        })}
      </ul>
    </>
  );
}

export const AlgoRoutes = () => {
  return (
    <GenerateRoutes prefix={prefix} rootPage={AlgoLinks} pages={pages}>
      <SearchRoutes/>
    </GenerateRoutes>
  );
}
